CREATE TABLE Categoria (
                           nome VARCHAR(255) NOT NULL,
                           descrizione VARCHAR(255) not null,
                           id int NOT NULL AUTO_INCREMENT,
                           PRIMARY KEY(id)
);

CREATE TABLE Luogo(
                      nome varchar (255) NOT NULL,
                      indirizzo varchar (255) NOT NULL,
                      email varchar (255) NOT NULL,
                      username varchar (255) NOT NULL,
                      password varchar (255) NOT NULL,
                      id int NOT NULL AUTO_INCREMENT,

                      PRIMARY KEY (id)
);

create table Evento_g(
                         nome varchar(255) not null,
                         data_e Date not null,
                         id_luogo int not null,
                         id_categoria int not null,
                         descrizione varchar(255) not null,
                         id int NOT NULL AUTO_INCREMENT,

                         primary key(id),
                         foreign key(id_luogo) references Luogo(id),
                         foreign key(id_categoria) references Categoria(id)
);

CREATE TABLE Evento_p(
                         nome varchar (255) NOT NULL,
                         data_e date NOT NULL,
                         prezzo float NOT NULL,
                         posti_disponibili int NOT NULL,
                         posti_totali int not null,
                         id_luogo int not null,
                         id_categoria int not null,
                         descrizione varchar(255) not null,
                         id int NOT NULL AUTO_INCREMENT,


                         PRIMARY KEY (id) ,
                         FOREIGN KEY (id_categoria) REFERENCES Categoria(id),
                         FOREIGN KEY (id_luogo) REFERENCES Luogo(id)
);

CREATE TABLE Utente_R(
                         nome varchar (255) NOT NULL,
                         cognome varchar (255) NOT NULL,
                         CF varchar (255) NOT NULL,
                         username varchar (255) NOT NULL,
                         password varchar (255) NOT NULL,
                         punti int NOT NULL,
                         email varchar(255) NOT NULL,
                         id int NOT NULL AUTO_INCREMENT,


                         PRIMARY KEY (id)
);

CREATE TABLE Commento_p (
                            bannato boolean not null,
                            testo VARCHAR(255)NOT NULL,
                            id int NOT NULL AUTO_INCREMENT,
                            id_utente INT NOT NULL,
                            id_evento int NOT NULL,


                            PRIMARY KEY (id),
                            FOREIGN KEY (id_utente) references Utente_r(id),
                            FOREIGN KEY (id_evento) references Evento_p(id)
);

create table Carta(
                      CF_titolare varchar(255) not null,
                      ccv int not null,
                      data_di_scadenza Date not null,
                      numerocarta int not null,
                      id int not null AUTO_INCREMENT,


                      primary key(id)
);

create table Acquisto(
                         data Date not null,
                         importo float not null,
                         id int not null AUTO_INCREMENT,
                         id_carta int not null,
                         id_utente int not null,

                         primary key(id),
                         foreign key(id_utente) references Utente_R(id),
                         foreign key(id_carta) references Carta(id)
);

CREATE TABLE Biglietto (
                           prezzo FLOAT NOT NULL,
                           id INT NOT NULL AUTO_INCREMENT,
                           id_evento int NOT NULL,
                           id_acquisto int NOT NULL,
                           id_utente int NOT NULL,

                           PRIMARY KEY (id),
                           FOREIGN KEY (id_evento) references Evento_p (id),
                           FOREIGN KEY ( id_acquisto) references Acquisto(id),
                           FOREIGN KEY ( id_utente) references utente_r(id)
);

CREATE TABLE immagine(
                         id INT NOT NULL AUTO_INCREMENT,
                         data longblob not null,
                         type varchar(255) not null,
                         id_esterno int not null,
                         classe_esterna varchar(255) not null,

                         primary key(id)
);
